import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// import containers
import MainPage from './containers/MainPage';

export default function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element=<MainPage></MainPage> />
      </Routes>
    </Router>
  )
}
